import axios from 'axios';

const GET_BALANCE = (queryParams) => https+'://'+`api.openweathermap.org/data/2.5/onecall?lat=${queryParams.lat}&lon=${queryParams.lon}&units=metric&appid=a26c08e53ef12ab6b0b246020b9726e1`

const getBalance = (queryParams) => axios.get(GET_BALANCE(queryParams))

export{
    getBalance 
}
